Fully Trusted: CXL Device can get access on CXL.$ for host-attached and device attached memory ranges in the WB address space;
Partially Trusted: CXL Device can get access on CXL.$ for device attached memory ranges only;
Untrusted: All requests on CXL.$ will be aborted by the Host.
Auto - Auto decides based on Si Compatibility.
